import Paciente from "./components/Paciente";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <Paciente nombre="Daniel" edad="20"></Paciente>
      <Paciente nombre="Gina" edad="18"></Paciente>
    </div>
  );
}

export default App;
